import React from 'react';
import './App.css';
import YouTube from './Youtube';
import Results from './Results';

function App() {
    console.clear();
    return (
        <div>
            <header>
                <p>YouTube Demo</p>
                <input></input>
                <button onClick={() => this.searchHandler()}>Search</button>
            </header>
            <div className="App">
                <YouTube />
                <Results />
            </div>
        </div>
    );
}

export default App;
